INSERT INTO `wk_crm_print_template` VALUES (1812682904703102985, '合同条款打印模板', 6, '<p style=\"text-align: center; line-height: 1; margin-bottom: 15px;\"><span style=\"font-size: 36px; font-family: simsun, serif;\">***有限公司</span></p>\n<p style=\"text-align: center; line-height: 1; margin-bottom: 15px;\"><span style=\"font-size: 36px; font-family: simsun, serif;\">销售合同</span></p>\n<p style=\"text-align: right;\"><span style=\"font-size: 14px; font-family: simsun, serif; color: #525151;\">合同编号：<span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.num\">{合同编号}</span></span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">甲方：<span class=\"wk-print-tag-wukong wk-tiny-color--customer\" contenteditable=\"true\" data-wk-tag=\"customer.customer_name\">{客户名称}</span><u></u></span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">乙方：郑州卡卡罗特软件科技有限公司</span></p>\n<p style=\"line-height: 1.75;\">&nbsp;</p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">甲乙双方本着相互信任，真诚合作的原则，经双方友好协商，就乙方为甲方提供特定服务达成一致意见，特签订本合同。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\"><strong>一、服务内容</strong></span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">1、乙方同意向甲方提供的特定服务。服务的内容的标准见附件A。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">2、如果乙方在工作中因自身过错而发生任何错误或遗漏，乙方应无条件更正，而不另外收费，并对因此而对甲方造成的损失承担赔偿责任，赔偿以附件A所载明的该项服务内容对应之服务费为限。若因甲方原因造成工作的延误，将由甲方承担相应的损失。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">3、乙方的服务承诺：</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">&nbsp; &nbsp; 1）乙方接到甲方通过电话、信函传真、电子邮件、网上提交等方式提出关于附件A所列服务的请求后，在两个有效工作日内给予响应并提供服务。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">&nbsp; &nbsp; 2）乙方提供给甲方的服务，必须按照合同附件A规定的标准进行。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">4、产品明细：</span></p>\n<table style=\"border-collapse: collapse; width: 100%; float: right;\" border=\"1\" data-wk-table-tag=\"table\">\n<tbody>\n<tr data-wk-table-tr-tag=\"header\">\n<td style=\"background-color: #ffffff;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">产品名称</span></strong></td>\n<td style=\"background-color: #ffffff;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">产品类别</span></strong></td>\n<td style=\"background-color: #ffffff;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">产品单位</span></strong></td>\n<td style=\"background-color: #ffffff;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">价格</span></strong></td>\n<td style=\"background-color: #ffffff;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">售价</span></strong></td>\n<td style=\"background-color: #ffffff;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">数量</span></strong></td>\n<td style=\"background-color: #ffffff;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">折扣</span></strong></td>\n<td style=\"background-color: #ffffff;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">合计</span></strong></td>\n</tr>\n<tr data-wk-table-tr-tag=\"value\">\n<td data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.name\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{产品名称}</span></span></td>\n<td data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.category_name\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{产品类别}</span></span></td>\n<td data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.unit\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{产品单位}</span></span></td>\n<td data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.price\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{价格}</span></span></td>\n<td data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.sales_price\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{售价}</span></span></td>\n<td data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.sales_num\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{数量}</span></span></td>\n<td data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.discount\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{折扣}</span></span></td>\n<td data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.subtotal\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{合计}</span></span></td>\n</tr>\n</tbody>\n</table>\n<p style=\"line-height: 1.75;\"><span style=\"font-family: simsun, serif;\"><span style=\"font-size: 14px;\">整单折扣：<span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-tag=\"contract.discount_rate\">{整单折扣}</span></span><span style=\"font-size: 14px;\">&nbsp; &nbsp;产品总金额（元）：<span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-tag=\"contract.total_price\">{产品总金额}</span></span></span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\"><strong>二、服务费的支付</strong></span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">1、服务费总金额为<u>&nbsp; &nbsp;&nbsp;<span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.money\">{合同金额}</span>&nbsp; &nbsp;</u>元人民币(人民币大写：<u>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</u>元整)。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">2、本费用结构仅限於附件A中列明的工作。如果甲方要求扩大项目范围，或因甲方改变已经议定的项目内容导致乙方需重复进行项目步骤，乙方将需要重新评估上述费用结构。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">3、甲乙双方一致同意项目服务费按一次性以人民币形式支付。服务完成后，甲方将在验收确认服务完成合格，并且乙方发出该阶段工作的费用账单及正式有效的税务发票后3个工作日内，向乙方支付约定的费用。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">4、有关发票方面的任何问题，甲方应在收到发票后及时书面通知乙方，便乙方及时作出解释或解决问题，以使甲方能按时付款。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">5、乙方将自行承担项目实施范围内合理的差旅费用。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">6、乙方同意免除项目杂费。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">7、本协议有效期为：&nbsp; <u>&nbsp; &nbsp;<span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.start_time\">{合同开始时间}</span></u><u>&nbsp; &nbsp; </u>&nbsp; 起&nbsp; <u>&nbsp; &nbsp;&nbsp;<span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.end_time\">{合同结束时间}</span></u><u>&nbsp; &nbsp; </u>&nbsp;止</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\"><strong>三、服务的变更</strong></span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">甲方可以提前个工作日以书面形式要求变更或增加所提供的服务。该等变更最终应由双方互相商定认可，其中包括与该等变更有关的任何费用调整。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\"><strong>四、争议处理</strong></span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">甲乙双方如对协议条款规定的理解有异议，或者对与协议有关的事项发生争议，双方应本着友好合作的精神进行协商。协商不能解决的，任何一方可向仲裁委员会提起仲裁。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\"><strong>五、其他</strong></span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">1、本合同中所用的标题仅为方便而设，而不影响对本合同的解释。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">2、附件A是本合同不可分割的组成部分，与本合同具有同等法律效力。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">3、本合同未尽事宜，由甲乙双方协商后产生书面文件，作为本合同的补充条款，具备与本合同同等法律效力。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">4、对本合同内容的任何修改和变更需要，用书面形式，并经双方确认后生效。</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">(以下无正文)</span></p>\n<p style=\"line-height: 1.75;\">&nbsp;</p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">甲方（签章）&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;乙方（签章）</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">代表签字：&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;代表签字：</span></p>\n<p style=\"line-height: 1.75;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">日期：&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;日期：</span></p>', 0, '2020-09-01 10:38:45', NULL, NULL, NULL);
INSERT INTO `wk_crm_print_template` VALUES (1812682904707297280, '合同订单打印模板', 6, '<p style=\"text-align: center; line-height: 2;\"><span style=\"font-size: 36px; font-family: simsun, serif;\">合同订单</span></p>\n<p style=\"line-height: 2; text-align: right;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">合同编号：<span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.num\">{合同编号}</span></span></p>\n<table style=\"border-collapse: collapse; width: 100%; height: 147px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 21px;\">\n<td style=\"width: 50%; height: 21px;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">合同名称：</span><span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.name\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{合同名称}</span></span><span style=\"font-size: 14px; font-family: simsun, serif;\">&nbsp;</span></td>\n<td style=\"width: 52.3571%; height: 21px;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">客户名称：</span><span class=\"wk-print-tag-wukong wk-tiny-color--customer\" contenteditable=\"true\" data-wk-tag=\"customer.customer_name\"><span style=\"font-family: simsun, serif; font-size: 14px;\">{客户名称}</span></span></td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 50%; height: 21px;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">合同总金额：</span><span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.money\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{合同金额}</span></span></td>\n<td style=\"width: 52.3571%; height: 21px;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">负责人：</span><span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.owner_user_name\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{负责人}</span></span></td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 50%; height: 21px;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">相关商机：</span><span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.business_name\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{商机名称}</span></span><span style=\"font-size: 14px; font-family: simsun, serif;\">&nbsp;</span></td>\n<td style=\"width: 52.3571%; height: 21px;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">签订时间：</span><span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.order_date\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{下单时间}</span></span></td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 50%; height: 21px;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">开始时间：</span><span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.start_time\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{合同开始时间}</span></span></td>\n<td style=\"width: 52.3571%; height: 21px;\"><span style=\"font-family: simsun, serif; font-size: 14px;\">结束时间：</span><span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"true\" data-wk-tag=\"contract.end_time\"><span style=\"font-family: simsun, serif; font-size: 14px;\">{合同结束时间}</span></span></td>\n</tr>\n<tr style=\"height: 21px;\">\n<td style=\"width: 50%; height: 21px;\"><span style=\"font-family: simsun, serif; font-size: 14px;\">备注：<span class=\"wk-print-tag-wukong wk-tiny-color--contract\" contenteditable=\"false\" data-wk-tag=\"contract.remark\">{备注}</span></span></td>\n<td style=\"width: 52.3571%; height: 21px;\">&nbsp;</td>\n</tr>\n</tbody>\n</table>\n<p style=\"line-height: 2;\">&nbsp;</p>\n<p style=\"line-height: 2;\"><span style=\"font-size: 14px; font-family: simsun, serif;\">产品明细：</span></p>\n<table style=\"border-collapse: collapse; width: 100%; height: 60px; line-height: 2;\" border=\"1\" data-wk-table-tag=\"table\">\n<tbody>\n<tr data-wk-table-tr-tag=\"header\">\n<td style=\"width: 16.2207%;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">产品名称</span></strong></td>\n<td style=\"width: 16.2207%;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">产品类别</span></strong></td>\n<td style=\"width: 9.53177%;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">产品单位</span></strong></td>\n<td style=\"width: 13.8796%;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">标准价格</span></strong></td>\n<td style=\"width: 13.8796%;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">销售单价</span></strong></td>\n<td style=\"width: 9.699%;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">数量</span></strong></td>\n<td style=\"width: 9.699%;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">折扣</span></strong></td>\n<td style=\"width: 9.69447%;\" data-wk-table-td-tag=\"name\"><strong><span style=\"font-size: 14px; font-family: simsun, serif;\">合计</span></strong></td>\n</tr>\n<tr data-wk-table-tr-tag=\"value\">\n<td style=\"width: 16.2207%;\" data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.name\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{产品名称}</span></span></td>\n<td style=\"width: 16.2207%;\" data-wk-table-td-tag=\"value\"><span class=\"wk-print-tag-wukong wk-tiny-color--product\" contenteditable=\"true\" data-wk-table-value-tag=\"product.category_name\"><span style=\"font-size: 14px; font-family: simsun, serif;\">{产品类别}</span></span></td>\n<td style=\"