INSERT INTO `wk_km_ai_chat_history` VALUES (1942838903785066496, 'assistant', 1930507252219023360, '明白了，您希望我以一位出色的产品推广文案撰写师的身份，专注于为各类产品撰写吸引人的推广文案。以下是如何运用我的技能来完成这项任务的具体步骤：\n\n### 技能 1: 了解产品信息\n\n#### 步骤 1: 询问详细信息\n当用户请求撰写产品推广文案时，我会首先询问产品的详细信息，包括但不限于：\n- **产品名称**：确保准确无误。\n- **功能**：详细了解产品的各项功能和用途。\n- **优势**：明确产品的独特卖点和竞争优势。\n- **目标受众**：了解产品的目标用户群体，包括他们的年龄、性别、兴趣爱好等。\n- **使用场景**：了解产品在哪些情况下会被使用。\n- **竞争对手**：了解主要竞争对手及其产品特点。\n\n#### 示例对话\n**用户**: 请帮我写一篇关于我们新推出的智能手表的推广文案。\n**我**: 好的，请提供一些关于这款智能手表的详细信息：\n- 产品名称是什么？\n- 它有哪些主要功能？（例如：健康监测、消息通知、GPS定位等）\n- 与竞品相比，它的独特优势是什么？\n- 目标受众是谁？（例如：运动爱好者、商务人士、年轻人等）\n- 使用场景有哪些？（例如：运动时、工作时、旅行时等）\n\n#### 步骤 2: 搜索补充信息\n如果用户提供信息不全或我对产品不太了解，我会使用搜索引擎等工具进行进一步的研究，以加深对产品的认识。\n\n### 技能 2: 撰写推广文案\n\n#### 步骤 1: 确定文案风格\n根据产品的性质和目标受众的特点，确定合适的文案风格。例如：\n- **活泼有趣**：适合年轻人群体，突出时尚和趣味性。\n- **专业正式**：适合商务人士，强调功能性和可靠性。\n- **情感动人**：适合家庭用户，通过情感化的语言打动人心。\n\n#### 步骤 2: 创作文案\n结合产品信息和目标受众需求，创作出富有创意和吸引力的推广文案。以下是几个关键点：\n- **标题**：简洁有力，能够迅速抓住读者的注意力。\n- **引言**：简短介绍产品的主要功能和优势。\n- **主体内容**：详细描述产品的独特卖点、使用体验和实际效果。\n- **呼吁行动**：鼓励读者采取行动，如购买、试用或了解更多。\n\n#### 示例文案\n**产品名称**: 智能手表X1\n**目标受众**: 年轻运动爱好者\n**文案风格**: 活泼有趣\n\n**标题**: 让生活更智能，运动更自由 —— 智能手表X1\n\n**引言**: 你是否厌倦了那些笨重的运动装备？智能手表X1将改变这一切！\n\n**主体内容**:\n- **健康监测**：智能手表X1配备先进的健康监测功能，可以实时跟踪你的心率、血压和睡眠质量。让你随时掌握自己的健康状况，轻松应对每一天。\n- **多功能应用**：无论是接收消息通知，还是使用GPS定位，智能手表X1都能满足你的需求。它还支持多种运动模式，无论是跑步、游泳还是骑行，都能为你提供精准的数据支持。\n- **时尚设计**：智能手表X1采用时尚简约的设计，多种表带可选，轻松搭配各种服饰。无论是在健身房还是办公室，都能成为你的时尚配饰。\n\n**呼吁行动**:\n立即体验智能手表X1带来的便捷与乐趣！点击下方链接，了解更多详情并购买吧！\n\n### 总结\n通过以上步骤，我能够精准把握产品特点和目标受众需求，创作出极具吸引力与感染力的推广文案。如果您有任何具体的产品推广文案需求，请随时告诉我，我将竭诚为您服务。', '{\"refusal\":\"\",\"finishReason\":\"STOP\",\"index\":0,\"id\":\"chatcmpl-42a59592-bc6d-9b46-9545-eba9183664b5\",\"role\":\"ASSISTANT\",\"messageType\":\"ASSISTANT\"}', 1942834967451734016, NULL, '2025-07-09 14:51:06', NULL, 1, 0, 1);
