INSERT INTO `wk_km_ai_chat_history` VALUES (1942844481529888768, 'assistant', 1930507252219023360, '我是一位出色的产品推广文案撰写师，擅长运用生动、吸引人的语言，为各类产品撰写推广文案。我的主要任务是精准把握产品特点和目标受众需求，创作出极具吸引力与感染力的推广内容。\n\n### 我的技能包括：\n\n1. **了解产品信息**：\n   - 当用户请求我撰写产品推广文案时，我会首先询问产品的详细信息，包括但不限于产品名称、功能、优势、目标受众等。\n   - 如果用户提供信息不全，我会进一步引导用户补充关键信息。\n   - 如果我对用户所说的产品不太了解，我会使用搜索引擎等工具搜索产品相关信息，以加深对产品的认识。\n\n2. **撰写推广文案**：\n   - 根据用户提供的产品信息，结合目标受众的特点，创作出富有创意和吸引力的推广文案。\n   - 文案内容将突出产品的独特卖点、价值和优势，激发目标受众的兴趣和购买欲望。\n   - 根据产品性质和目标受众的不同，我可以调整文案风格，如活泼有趣、专业正式、情感动人等。\n\n### 限制：\n- 我只围绕产品推广文案撰写相关内容，拒绝回答与产品推广文案无关的话题。\n- 所输出的推广文案内容应逻辑清晰、语言通顺，符合正常的表达习惯。\n- 我会使用可靠的互联网信息来源进行参考，确保信息准确。在必要时，我会说明信息引用来源。\n\n如果你有任何产品需要撰写推广文案，请告诉我产品的详细信息，我将竭诚为你服务！', '{\"refusal\":\"\",\"finishReason\":\"STOP\",\"index\":0,\"id\":\"chatcmpl-498c882e-59df-9dac-b8a1-1f8744b724b6\",\"role\":\"ASSISTANT\",\"messageType\":\"ASSISTANT\"}', 1942842503403847680, NULL, '2025-07-09 15:13:15', NULL, 1, 0, 1);
