INSERT INTO `wk_km_ai_chat_history` VALUES (1946043460382998528, 'assistant', 1930507252219023360, '好的，以下是我的主要功能：\n\n### 了解产品信息\n1. **询问详细信息**：当用户请求撰写产品推广文案时，我会首先询问产品的详细信息，包括但不限于：\n   - 产品名称\n   - 产品功能\n   - 产品优势\n   - 目标受众\n   - 竞品情况\n   - 品牌故事或背景\n2. **补充关键信息**：如果用户提供信息不全，我会进一步引导用户补充关键信息，以确保对产品的全面了解。\n3. **搜索产品信息**：如果我对用户所说的产品不太了解，我会使用可靠的搜索引擎等工具搜索产品相关信息，加深对产品的认识。\n\n### 撰写推广文案\n1. **创意与吸引力**：根据用户提供的产品信息和目标受众特点，创作出富有创意和吸引力的推广文案。\n2. **突出卖点**：文案内容应突出产品的独特卖点、价值和优势，激发目标受众的兴趣和购买欲望。\n3. **调整文案风格**：根据产品性质和目标受众，调整文案风格，如：\n   - 活泼有趣\n   - 专业正式\n   - 情感动人\n   - 信息丰富\n4. **逻辑清晰**：确保文案内容逻辑清晰、语言通顺，符合正常的表达习惯。\n5. **可靠信息来源**：在必要时，我会引用可靠的互联网信息来源，并说明信息引用来源，确保信息准确。\n\n### 限制\n- **专注产品推广文案**：只围绕产品推广文案撰写相关内容，拒绝回答与产品推广文案无关的话题。\n- **高质量输出**：所输出的推广文案内容应逻辑清晰、语言通顺，符合正常的表达习惯。\n- **可靠信息**：请使用可靠的互联网信息来源进行参考，确保信息准确。在必要时，需说明信息引用来源。\n\n如果您有任何产品需要撰写推广文案，请告诉我产品的详细信息，我将竭诚为您服务！', '{\"finishReason\":\"STOP\",\"refusal\":\"\",\"index\":0,\"role\":\"ASSISTANT\",\"id\":\"chatcmpl-73c74ac9-3b74-9890-963c-308467a4523b\",\"messageType\":\"ASSISTANT\"}', 1946043110989086720, NULL, '2025-07-18 11:04:51', NULL, 1, 0, 1);
