-- ----------------------------
-- Table structure for wk_admin_business_card
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_business_card`;
CREATE TABLE `wk_admin_business_card`  (
  `id` bigint NOT NULL,
  `file_id` bigint NOT NULL COMMENT '文件表id',
  `value` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '返回信息',
  `batch_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '批次id',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `create_user_id` bigint NULL DEFAULT NULL,
  `update_user_id` bigint NULL DEFAULT NULL,
  `ai_discern_flag` int NOT NULL DEFAULT 0 COMMENT '扫描标识,0是扫描中,1是扫描完成',
  `model_label` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '保存到哪个模块了线索 ,客户,联系人',
  `data_id` bigint NULL DEFAULT NULL COMMENT '对应模块的表主键id',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '姓名',
  `phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '手机号',
  `email_addr` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '邮箱',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '地址',
  `vxcode` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '微信号',
  `company` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '公司',
  `position` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '职位',
  `file_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '文件路径',
  `status` int NOT NULL DEFAULT 0 COMMENT '1是保存后的数据',
  `tel_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '电话',
  `fax_addr` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '传真',
  `website` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '网址',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `batch_id`(`batch_id` ASC) USING BTREE,
  INDEX `file_id`(`file_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '名片扫描表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_admin_business_card
-- ----------------------------

-- ----------------------------
-- Table structure for wk_admin_company
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_company`;
CREATE TABLE `wk_admin_company`  (
  `id` bigint NOT NULL,
  `phone` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '登录账号',
  `company_source` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业注册来源',
  `discount` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业注册优惠码',
  `company_status` int NOT NULL COMMENT '企业状态 1 正常 0 禁用',
  `company_manage` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '公司超级管理员ID',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `verify_user` tinyint(1) NOT NULL COMMENT '用户是否已验证',
  `verify_email` tinyint(1) NULL DEFAULT 0 COMMENT '邮箱是否已验证',
  `account_number` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '积分平台账号',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `company_id`(`phone` ASC) USING BTREE,
  INDEX `phone`(`phone` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '云平台公司配置表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_admin_company
-- ----------------------------

-- ----------------------------
-- Table structure for wk_admin_company_access
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_company_access`;
CREATE TABLE `wk_admin_company_access`  (
  `id` bigint NOT NULL,
  `access_key` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '通道key',
  `access_secret` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '通道秘钥',
  `source` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '来源',
  `trusty_ip` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '可信任的IP，可以填10个',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `access_key`(`access_key` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '企业与第三方对接登录表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_admin_company_access
-- ----------------------------

-- ----------------------------
-- Table structure for wk_admin_company_ctrip
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_company_ctrip`;
CREATE TABLE `wk_admin_company_ctrip`  (
  `id` bigint NOT NULL,
  `source` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '渠道来源子ID(由平台传入的值，用于同一平台下多个应用的区分；可以为空，为空则默认为“default”)',
  `company` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '公司编号(对接平台用户的公司编号,最大长度支持50个字符)',
  `company_name` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '公司名称(请填写与平台合作协议上的用户公司名称,最大长度支持50个字符  )',
  `app_key` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '接入账号(在第三方系统落地，后续接口需要用到这些参数)',
  `app_security` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '接入密码(在第三方系统落地，后续接口需要用到这些参数)',
  `ctrip_corpid` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '携程公司编号(在第三方系统落地，后续接口需要用到这些参数)',
  `authorize_type` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '审批方式(非提前审批管控：0 ，提前审批管控：1。可以为空，为空则默认为0。审批方式在创建公司后会被固定，固定后如果要修改，请通过调用授权方式切换服务进行切换，0和1不能并存)',
  `version_id` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL COMMENT '版本号(默认值R002；非提前审批方式为R002，提前审批方式为R003。非标准对接不属于以上版本，请联系相关工作人员另外获取版本号)',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci COMMENT = '携程企业配置表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_admin_company_ctrip
-- ----------------------------

-- ----------------------------
-- Table structure for wk_admin_company_ding
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_company_ding`;
CREATE TABLE `wk_admin_company_ding`  (
  `id` bigint NOT NULL COMMENT '主键id',
  `agentid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微应用ID',
  `corpid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '授权企业的CorpId',
  `invite_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '邀请码，只有自己邀请的企业才会返回邀请码，可用该邀请码统计不同渠道的拉新，否则值为空字符串',
  `industry` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业所属行业',
  `corp_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '授权方企业名称',
  `license_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '序列号',
  `auth_channel` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '渠道码',
  `auth_channel_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '渠道类型。为了避免渠道码重复，可与渠道码共同确认渠道。可能为空，非空时当前只有满天星类型，值为STAR_ACTIVITY',
  `auth_level` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业认证等级：0：未认证1：高级认证2：中级认证3：初级认证',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `auth_mode` int NOT NULL DEFAULT 0 COMMENT '授权模式，0为管理员授权；1为成员授权',
  `app_type` int NOT NULL DEFAULT 1 COMMENT '应用类型：1 CRM 2 JXC',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '钉钉企业配置表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_admin_company_ding
-- ----------------------------

