-- Table structure for wk_admin_company_fly
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_company_fly`;
CREATE TABLE `wk_admin_company_fly`  (
  `id` bigint NOT NULL COMMENT '主键id',
  `tenant_key` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '授权方企业唯一标识',
  `app_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'app_id ',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `display_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业编号，平台内唯一',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '飞书配置表' ROW_FORMAT = DYNAMIC;

