-- ----------------------------
-- Table structure for wk_admin_company_manager
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_company_manager`;
CREATE TABLE `wk_admin_company_manager`  (
  `id` bigint NOT NULL COMMENT '主键ID',
  `company_domain` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '企业域名配置',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime NULL DEFAULT NULL COMMENT '结束时间',
  `num` int NOT NULL COMMENT '授权人数',
  `call_num` int NULL DEFAULT 0 COMMENT '呼叫中心人数',
  `remarks` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `register_address` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '注册地址',
  `register_email` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '注册邮箱',
  `integral` bigint NOT NULL DEFAULT 0 COMMENT '积分',
  `invite_code` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '邀请码',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `company_domain`(`company_domain` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '云平台注册用户表' ROW_FORMAT = DYNAMIC;

