-- ----------------------------
-- Table structure for wk_admin_dept
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_dept`;
CREATE TABLE `wk_admin_dept`  (
  `dept_id` bigint NOT NULL,
  `parent_id` bigint NULL DEFAULT 0 COMMENT '父级ID 顶级部门为0',
  `name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '部门名称',
  `num` int NULL DEFAULT NULL COMMENT '排序 越大越靠后',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '部门备注',
  `owner_user_id` bigint NULL DEFAULT NULL COMMENT '部门负责人',
  `open_dept` int NULL DEFAULT 0 COMMENT '是否共享部门',
