-- ----------------------------
-- Table structure for wk_admin_ding_order
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_ding_order`;
CREATE TABLE `wk_admin_ding_order`  (
  `id` bigint NOT NULL,
  `order_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '订单id',
  `sync_action` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '该订单对应的用户操作。当syncAction为market_order时，表示市场订单支付',
  `goods_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '商品名称',
  `goods_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '商品码',
  `item_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '规格名称',
  `item_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '规格码',
  `sub_quantity` int NULL DEFAULT NULL COMMENT '购买数量',
  `max_of_people` int NULL DEFAULT NULL COMMENT '规格支持最大使用人数',
  `min_of_people` int NULL DEFAULT NULL COMMENT '规格支持最小使用人数',
  `corp_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '购买企业的corpId',
  `paid_time` datetime NULL DEFAULT NULL COMMENT '支付时间',
  `service_stop_time` datetime NULL DEFAULT NULL COMMENT '服务结束时间',
  `order_creat_source` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '订单来源：默认订单来自应用中心。若值为TIANYUAN，表示来自天元系统平台',
  `pay_fee` decimal(10, 2) NULL DEFAULT NULL COMMENT '实际支付价格',
  `service_start_time` datetime NULL DEFAULT NULL COMMENT '服务开始时间',
  `order_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '订单类型，取值：BUY：新购 RENEW：续费 UPGRADE：升级 RENEW_UPGRADE：续费升配 RENEW_DEGRADE：续费降配',
  `union_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '下单人unionId',
  `out_trade_no` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '外部订单号',
  `main_goods_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '内购商品关联的主应用商品code',
  `sale_model_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '售卖模式，取值： CYC_UPGRADE_MEMBER： 按周期 + 数量（人数）售卖 CYC_UPGRADE： 按周期售卖 QUANTITY： 按数量（人数）售卖',
  `status` int NULL DEFAULT NULL COMMENT '订单状态：0-待支付，1-已支付，2-已取消，3-退款',
  `instance_end_time` datetime NULL DEFAULT NULL COMMENT '退款时间',
  `application_type` int NULL DEFAULT NULL COMMENT '订单类型：1 CRM 2 JXC',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_status_company`(`status` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '钉钉订单表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of wk_admin_ding_order
-- ----------------------------

-- ----------------------------
-- Table structure for wk_admin_file
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_file`;
CREATE TABLE `wk_admin_file`  (
  `file_id` bigint NOT NULL,
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '附件名称',
  `size` bigint NOT NULL COMMENT '附件大小（字节）',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '文件真实路径',
  `file_type` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT 'file' COMMENT '文件类型,file,img',
  `type` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '1 本地 2 阿里云oss',
  `source` int NULL DEFAULT NULL COMMENT '来源 0 默认 1 admin 2 crm 3 work 4 oa 5 进销存 6 hrm',
  `batch_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '批次id',
  `is_public` int NULL DEFAULT 0 COMMENT '1 公有访问 0 私有访问',
  `update_time` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
