-- ----------------------------
-- Table structure for wk_admin_fly_order_plan
-- ----------------------------
DROP TABLE IF EXISTS `wk_admin_fly_order_plan`;
CREATE TABLE `wk_admin_fly_order_plan`  (
  `id` bigint NOT NULL,
  `plan_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '方案名称',
  `price_plan_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '价格方案ID，唯一标识',
  `price_plan_type` varchar(155) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '用户购买方案类型 \"trial\" -试用；\"permanent\"-免费；\"per_year\"-企业年付费；\"per_month\"-企业月付费；\"per_seat_per_year\"-按人按年付费；\"per_seat_per_month\"-按人按月付费；\"permanent_count\"-按次付费',
  `seats_of` int NULL DEFAULT NULL COMMENT '人数是否限制 0 否 1是',
  `seats` int NULL DEFAULT NULL COMMENT '实际购买人数（对标上price_plan_type） 仅对price_plan_type为per_seat_per_year和per_seat_per_month 有效',
  `pay_price_year` decimal(10, 2) NULL DEFAULT NULL COMMENT '按企业付费 每年 支付价格',
  `pay_price_month` decimal(10, 2) NULL DEFAULT NULL COMMENT '按企业付费 每月 支付价格',
  `on_trial_day` int NULL DEFAULT NULL COMMENT '试用天数',
  `seats_max` int NULL DEFAULT NULL COMMENT '自定义最大人数',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '飞书订单方案' ROW_FORMAT = DYNAMIC;

