  `push_owner_user` int UNSIGNED NULL DEFAULT 1 COMMENT '是否推送负责人 0 否 1 是',
  `push_term_member` int UNSIGNED NULL DEFAULT 1 COMMENT '是否推送团队成员  0 否 1 是',
  `push_parent_user` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '0' COMMENT '是否推送上级，0为不推送，否则为上级层级',
  `push_custom_user` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '是否推送自定义用户，用户id数组，最多10位',
  `push_custom_dept` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '是否推送自定义用户，部门id数组，最多10位',
  `push_browser` int UNSIGNED NULL DEFAULT 0 COMMENT '是否开启浏览器通知 0 否 1 是',
  `push_sms` int UNSIGNED NULL DEFAULT 0 COMMENT '是否开启短信通知 0 否 1 是',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '系统消息通知配置表' ROW_FORMAT = DYNAMIC;

