  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `ident_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '通话标识',
  PRIMARY KEY (`call_record_id`) USING BTREE,
  INDEX `start_time`(`start_time` ASC) USING BTREE,
  INDEX `company_id`(`create_time` ASC) USING BTREE,
  INDEX `owner_user_id`(`owner_user_id` ASC) USING BTREE,
  INDEX `model`(`model` ASC, `model_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '通话记录' ROW_FORMAT = DYNAMIC;

