  `high_query_status_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '高级查询字段',
  `last_content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '最后一条跟进记录',
  PRIMARY KEY (`contract_id`) USING BTREE,
