DROP TABLE IF EXISTS `wk_crm_customer`;
CREATE TABLE `wk_crm_customer`  (
  `customer_id` bigint NOT NULL,
  `customer_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '客户名称',
  `followup` int NULL DEFAULT 0 COMMENT '跟进状态 0未跟进1已跟进',
  `is_lock` int NOT NULL DEFAULT 0 COMMENT '1锁定',
  `next_time` datetime NULL DEFAULT NULL COMMENT '下次联系时间',
  `deal_status` int NULL DEFAULT 0 COMMENT '成交状态 0 未成交 1 已成交',
  `deal_time` datetime NULL DEFAULT NULL COMMENT '成交时间',
  `contacts_id` bigint NULL DEFAULT NULL COMMENT '首要联系人ID',
  `mobile` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '手机',
  `telephone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '电话',
  `website` varchar(800) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '网址',
  `email` varchar(225) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '邮箱',
  `remark` varchar(3000) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '备注',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `owner_user_id` bigint NULL DEFAULT NULL COMMENT '负责人ID',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '省市区',
  `location` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '定位信息',
  `detail_address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '详细地址',
  `lng` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '地理位置经度',
  `lat` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT '' COMMENT '地理位置维度',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '批次 比如附件批次',
  `status` int NULL DEFAULT 1 COMMENT '客户状态 1 正常 2锁定 3删除',
  `last_time` datetime NULL DEFAULT NULL COMMENT '最后跟进时间',
  `pool_time` datetime NULL DEFAULT NULL COMMENT '放入公海时间',
  `is_receive` int NULL DEFAULT NULL COMMENT '1 分配 2 领取',
  `last_content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '最后一条跟进记录',
  `receive_time` datetime NULL DEFAULT NULL COMMENT '接收到客户时间',
  `pre_owner_user_id` bigint NULL DEFAULT NULL COMMENT '进入公海前负责人id',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `is_wx_user` int NULL DEFAULT 0 COMMENT '客户类型 0系统客户 1企微客户',
  `external_userid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '企业微信外部联系人的userid',
  `scrm_customer_id` bigint NULL DEFAULT NULL COMMENT 'wk_scrm_customer表customer_id',
  `get_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '公海领取理由',
  `remind_user_ids` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '提醒用户ID',
