  `marketing_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '营销名称',
  `crm_type` bigint NOT NULL DEFAULT 1 COMMENT '1线索  2客户',
  `end_time` datetime NOT NULL COMMENT '截止时间',
  `relation_user_id` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '关联人员ID',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `status` int NOT NULL DEFAULT 1 COMMENT '1启用  0禁用',
  `second` int NOT NULL DEFAULT 0 COMMENT '每个客户只能填写次数 0 1',
  `field_data_id` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '营销内容填写字段',
  `browse` int NULL DEFAULT 0 COMMENT '浏览数',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `share_num` int NULL DEFAULT 0 COMMENT '分享数',
  `submit_num` int NULL DEFAULT 0 COMMENT '提交数',
  `synopsis` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '简介',
  `main_file_ids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '首图id',
  `detail_file_ids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL,
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '活动地址',
  `marketing_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '活动类型',
  `marketing_money` decimal(11, 2) NULL DEFAULT NULL COMMENT '活动金额',
  `relation_dept_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '关联部门id',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `is_need_child` int NULL DEFAULT 0 COMMENT '是否展示子级部门 0不需要 1 需要',
  `is_show_introduce` tinyint(1) NULL DEFAULT NULL COMMENT '是否开启市场活动介绍：1、是，0、否',
  `is_show_form` tinyint(1) NULL DEFAULT NULL COMMENT '是否开启表单填写：1、是，0、否',
  `expect_income` decimal(11, 2) NULL DEFAULT NULL COMMENT '市场活动预期收入',
  `actual_cost` decimal(11, 2) NULL DEFAULT NULL COMMENT '市场活动实际成本',
  `actual_income` decimal(11, 2) NULL DEFAULT NULL COMMENT '市场活动实际收入',
  PRIMARY KEY (`marketing_id`) USING BTREE,
  INDEX `status`(`status` ASC) USING BTREE,
  INDEX `parent_id`(`parent_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '营销表' ROW_FORMAT = DYNAMIC;

