-- ----------------------------
-- Table structure for wk_crm_marketing_form_setting
-- ----------------------------
DROP TABLE IF EXISTS `wk_crm_marketing_form_setting`;
CREATE TABLE `wk_crm_marketing_form_setting`  (
  `id` bigint NOT NULL COMMENT '主键ID',
  `form_id` bigint NULL DEFAULT NULL COMMENT '表单ID',
  `random_type` tinyint(1) NULL DEFAULT NULL COMMENT '随机设置：1、不设置，2、按题目随机（每页内题目随机），3、按分页随机（每页随机）',
  `submit_type` tinyint(1) NULL DEFAULT NULL COMMENT '填写设置：1、每个用户只能填写一次，2、每个用户每天只能填写一次，空不限制',
  `num_type` tinyint(1) NULL DEFAULT NULL COMMENT '系统题号：1、显示，2、隐藏',
  `time_limit_num` bigint NULL DEFAULT NULL COMMENT '考试设置-答题时间限制数',
  `time_limit_unit` tinyint(1) NULL DEFAULT NULL COMMENT '考试设置-答题时间限制单位：1、秒，2、分钟，3、小时',
  `force_submit_time_num` bigint NULL DEFAULT NULL COMMENT '防作弊设置-答题时多长时间没有新操作就强制交卷',
  `force_submit_time_unit` tinyint(1) NULL DEFAULT NULL COMMENT '防作弊设置-强制交卷时间单位：1、秒，2、分钟，3、小时',
  `switch_screen_num` int NULL DEFAULT NULL COMMENT '允许切屏次数，超过该次数就强制交卷',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `form_id`(`form_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '活动表单全局设置表' ROW_FORMAT = DYNAMIC;

