  `is_unique` int NULL DEFAULT 0 COMMENT '是否唯一 1 是 0 否',
  `is_null` int NULL DEFAULT 0 COMMENT '是否必填 1 是 0 否',
  `operating` int NULL DEFAULT 255 COMMENT '是否允许编辑',
  `precisions` int NULL DEFAULT NULL COMMENT '精度，允许的最大小数位',
