  `min_num_restrict` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '限制的最小数值',
  `phone_type` tinyint NULL DEFAULT NULL COMMENT '手机号位数类型  1-11位  2- （6-15）位',
