DROP TABLE IF EXISTS `wk_crm_quotation`;
CREATE TABLE `wk_crm_quotation`  (
  `quotation_id` bigint NOT NULL COMMENT 'id',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '报价单名称',
  `num` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '报价单编号',
  `customer_id` bigint NULL DEFAULT NULL COMMENT '客户ID',
  `contacts_id` bigint NULL DEFAULT NULL COMMENT '联系人id',
  `business_id` bigint NULL DEFAULT NULL COMMENT '商机id',
  `money` decimal(21, 6) NULL DEFAULT NULL COMMENT '报价金额',
  `quotation_time` date NULL DEFAULT NULL COMMENT '报价时间',
  `predict_time` datetime NULL DEFAULT NULL COMMENT '预计成交日期',
  `total_price` decimal(21, 6) NULL DEFAULT NULL COMMENT '产品总价',
  `discount_rate` decimal(21, 6) NULL DEFAULT NULL COMMENT '整单折扣',
  `quotation_status` int NULL DEFAULT NULL COMMENT '报价状态',
  `check_status` int NULL DEFAULT NULL COMMENT '0待审核、1通过、2拒绝、3审核中 4:撤回 5 未提交 6 创建 7 已删除 8 作废',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '批次 比如附件批次',
  `examine_record_id` bigint NULL DEFAULT NULL COMMENT '审核记录ID',
  `owner_user_id` bigint NULL DEFAULT NULL COMMENT '负责人ID',
  `create_user_id` bigint NOT NULL COMMENT '创建人ID',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '备注',
  `last_time` datetime NULL DEFAULT NULL COMMENT '最后跟进时间',
  `last_content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '最后一条跟进记录',
  `owner_user_phone` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '负责人手机号',
  PRIMARY KEY (`quotation_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '报价单' ROW_FORMAT = DYNAMIC;

