  `limit_time_id` bigint NULL DEFAULT NULL COMMENT '限时处理id',
  `user_id` bigint NULL DEFAULT NULL COMMENT '处理人',
  `role_id` bigint NULL DEFAULT NULL COMMENT '角色id',
  `parent_level` int NULL DEFAULT NULL COMMENT '指定上级',
  `sort` int NULL DEFAULT NULL COMMENT '处理顺序',
  `batch_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '批次id',
  `type` int NULL DEFAULT 0 COMMENT '0  指定用户 1 指定上级 2 角色 ',
  PRIMARY KEY (`handle_id`) USING BTREE
