-- ----------------------------
-- Table structure for wk_examine_record
-- ----------------------------
DROP TABLE IF EXISTS `wk_examine_record`;
CREATE TABLE `wk_examine_record`  (
  `record_id` bigint NOT NULL COMMENT '审核记录ID',
  `examine_id` bigint NOT NULL COMMENT '审核ID',
  `label` bigint NULL DEFAULT NULL COMMENT '业务类型',
  `flow_id` bigint NOT NULL COMMENT '流程ID',
  `type_id` bigint NULL DEFAULT NULL COMMENT '关联业务主键ID',
  `examine_status` int NULL DEFAULT NULL COMMENT '审核状态 0 未审核 1 审核通过 2 审核拒绝 3 审核中 4 已撤回',
  `examine_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '申请原因',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `create_user_id` bigint NOT NULL COMMENT '创建人',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `update_user_id` bigint NOT NULL COMMENT '修改人',
  PRIMARY KEY (`record_id`) USING BTREE,
  INDEX `create_user_id`(`create_user_id` ASC) USING BTREE,
  INDEX `examine_id`(`examine_id` ASC) USING BTREE,
  INDEX `type_id`(`type_id` ASC, `label` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '审核记录表' ROW_FORMAT = DYNAMIC;

