-- ----------------------------
-- Table structure for wk_examine_record_history_log
-- ----------------------------
DROP TABLE IF EXISTS `wk_examine_record_history_log`;
CREATE TABLE `wk_examine_record_history_log`  (
  `log_id` bigint NOT NULL,
  `examine_id` bigint NOT NULL COMMENT '审批ID',
  `flow_id` bigint NOT NULL COMMENT '审批流程ID',
  `type_id` bigint NOT NULL COMMENT '业务id',
  `record_id` bigint NOT NULL COMMENT '审批记录ID',
  `type` int NULL DEFAULT NULL COMMENT '1 依次审批 2 会签 3 或签',
  `sort` int NULL DEFAULT NULL COMMENT '排序',
  `examine_status` int NOT NULL COMMENT '审核状态0待审核、1通过、2拒绝、3审核中 4:撤回 5 未提交 6 创建 7 已删除 8 作废',
  `handler_type` int NULL DEFAULT NULL COMMENT '处理类型：1转交2:征求他人意见',
  `examine_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '申请原因',
  `examine_user_id` bigint NULL DEFAULT 0 COMMENT '审核人ID',
  `examine_role_id` bigint NULL DEFAULT 0 COMMENT '审核角色ID',
  `examine_time` datetime NULL DEFAULT NULL COMMENT '审核时间',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '批次ID',
  `remarks` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '审核备注',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `examine_user_email` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '外部审核人邮箱',
  `pass_flag` int NULL DEFAULT NULL COMMENT '处理结果类型',
  `read_flag` int NULL DEFAULT NULL COMMENT '读取结果类型',
  `rel_target` bigint NULL DEFAULT NULL COMMENT '关联id(转发使用)',
  `rel_target_flow_id` bigint NULL DEFAULT NULL,
  PRIMARY KEY (`log_id`) USING BTREE,
  INDEX `examine_user_id`(`examine_user_id` ASC) USING BTREE,
  INDEX `examine_user_email`(`examine_user_email` ASC) USING BTREE,
  INDEX `batch_id`(`batch_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '审核历史日志表' ROW_FORMAT = DYNAMIC;

