  PRIMARY KEY (`log_id`) USING BTREE,
  INDEX `create_user_id`(`create_user_id` ASC) USING BTREE,
  INDEX `record_id`(`record_id` ASC) USING BTREE,
  INDEX `batch_id`(`batch_id` ASC) USING BTREE,
  INDEX `flow_id`(`flow_id` ASC, `record_id` ASC) USING BTREE,
  INDEX `examine_user_id`(`examine_user_id` ASC) USING BTREE,
  INDEX `examine_user_email`(`examine_user_email` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '审核日志表' ROW_FORMAT = DYNAMIC;

