  `document_id` bigint NULL DEFAULT NULL COMMENT '文档id',
  `sync_status` tinyint NULL DEFAULT 0 COMMENT '解析状态(0未解析，1解析中 2已完成 3 停止解析）',
  `rag_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'rag对应的文件id',
  `chunk_count` bigint NULL DEFAULT NULL COMMENT '分块数',
  `progress` double NULL DEFAULT NULL COMMENT '解析进度',
  `rag_library_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'rag 数据集id',
  PRIMARY KEY (`parse_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '知识库文档解析表' ROW_FORMAT = DYNAMIC;

