  `end_type_config` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '2:次数/3:时间',
  `repeat_start_time` datetime NOT NULL COMMENT '循环开始时间',
  `repeat_end_time` datetime NULL DEFAULT NULL COMMENT '循环结束时间',
  `batch_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL,
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
