-- ----------------------------
-- Table structure for wk_oa_examine_category
-- ----------------------------
DROP TABLE IF EXISTS `wk_oa_examine_category`;
CREATE TABLE `wk_oa_examine_category`  (
  `category_id` bigint NOT NULL,
  `title` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '名称',
  `remarks` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '描述',
  `icon` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '图标',
  `type` int NULL DEFAULT 0 COMMENT '1 普通审批 2 请假审批 3 出差审批 4 加班审批 5 差旅报销 6 借款申请 0 自定义审批',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `status` int NULL DEFAULT 1 COMMENT '1启用，0禁用',
  `is_sys` int NULL DEFAULT NULL COMMENT '1为系统类型，不能删除',
  `examine_type` int NULL DEFAULT NULL COMMENT '1固定2自选',
  `user_ids` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '可见范围（员工）',
  `dept_ids` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '可见范围（部门）',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `is_deleted` int NULL DEFAULT 0 COMMENT '1已删除',
  `delete_time` datetime NULL DEFAULT NULL COMMENT '删除时间',
  `delete_user_id` bigint NULL DEFAULT NULL COMMENT '删除人ID',
