  `owner_user_id` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '团队成员ID',
  `status` int NULL DEFAULT 1 COMMENT '完成状态 1未开始 2进行中 3已完成 4延期5归档 6结束（后期根据配置判断）',
  `description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '描述',
  `start_time` datetime NULL DEFAULT NULL COMMENT '开始时间',
  `stop_time` datetime NULL DEFAULT NULL COMMENT '结束时间',
  `priority` int NULL DEFAULT 0 COMMENT '优先级 从大到小 3高 2中 1低 0无',
  `type` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '0 带规划 1迭代 2需求 3任务 4缺陷 ',
  `relation_ids` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '关联业务ID',
  `wiki` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '关联地址',
  `label` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '标签ID',
  `project_id` bigint NULL DEFAULT 0 COMMENT '项目ID',
  `top_order_num` int NULL DEFAULT 999 COMMENT '我的任务排序ID',
  `estimated_man_hours` int NULL DEFAULT NULL COMMENT '预估工时',
  `ishidden` int NULL DEFAULT 0 COMMENT '是否删除 0 未删除 1 删除',
  `hidden_time` datetime NULL DEFAULT NULL COMMENT '删除时间',
  `batch_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '批次',
  `owner_dept_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '关联部门',
  `update_user_id` bigint NULL DEFAULT NULL COMMENT '修改人ID',
  `belong_iteration_id` bigint NULL DEFAULT NULL COMMENT '所属迭代ID',
  `related_demand_id` bigint NULL DEFAULT NULL COMMENT '关联需求ID',
  `create_user_id` bigint NULL DEFAULT NULL COMMENT '创建人ID',
  `main_user_id` bigint NULL DEFAULT NULL COMMENT '负责人ID',
  `create_time` datetime NULL DEFAULT NULL COMMENT '新建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `board_status_id` bigint NULL DEFAULT NULL COMMENT '看板状态id',
  `num` int NULL DEFAULT NULL COMMENT '序号累加',
  `wrong_type` int NULL DEFAULT NULL COMMENT '缺陷类型',
  `pid` bigint NULL DEFAULT 0 COMMENT '父任务id',
  `progress` int NULL DEFAULT 0 COMMENT '进度',
  `finish_time` datetime NULL DEFAULT NULL COMMENT '迭代完成时间',
  `target` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '迭代目标',
  `color` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '颜色',
  `oa_type` int NOT NULL DEFAULT 0 COMMENT 'oa类型 0默认项目 1原oa处提交的任务+未来通过oa通道添加的任务',
  PRIMARY KEY (`task_id`) USING BTREE,
  INDEX `project_id`(`project_id` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1961730729328328705 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '任务表' ROW_FORMAT = DYNAMIC;

