-- ----------------------------
-- Function structure for toCamelCase
-- ----------------------------
DROP FUNCTION IF EXISTS `toCamelCase`;
delimiter ;;
CREATE FUNCTION `toCamelCase`(s VARCHAR(255))
 RETURNS varchar(255) CHARSET utf8mb4
  DETERMINISTIC
BEGIN
    DECLARE result VARCHAR(255) DEFAULT '';
    DECLARE word VARCHAR(50);
    DECLARE i INT DEFAULT 0;
    WHILE LOCATE('_', s) > 0 DO
        SET word = SUBSTRING_INDEX(s, '_', 1);
        IF i = 0 THEN
            SET result = LOWER(word);
        ELSE
            SET result = CONCAT(result, UPPER(LEFT(word, 1)), LOWER(SUBSTRING(word, 2)));
        END IF;
        SET s = SUBSTRING(s, LOCATE('_', s) + 1);
        SET i = i + 1;
    END WHILE;
    -- Append last word
    SET result = CONCAT(result, UPPER(LEFT(s, 1)), LOWER(SUBSTRING(s, 2)));
    RETURN result;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
